
var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 1000,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {

        this.load.add('bg','assets/bg.png')

        var sss = new Image();
        sss.onload = () => {
            this.textures.addAtlas('shapes', sss, shapes);
        };
        sss.src = assets.shapes;

        var ttt = new Text();
        ttt.onload = () => {
            this.textures.add('shapes', ttt, shapes);
        };
        ttt.src = assets.shapes;

        // this.load.atlas('shapes', 'assets/shapes.png',"assets/shapes.json");
        this.load.text('particle-effect', 'assets/MyProject.json');
      }
      
      create() {
        var bg = this.add.image(0,0,'bg').setOrigin(0,0)
        var abs = this.add.particles('shapes',  MyProject);
        console.log(new Function('return ' + this.cache.text.get('particle-effect'))())
        console.log(abs)
        
      }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

